import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Footer from '../Components/Footer';

class UniversityData extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>{this.props.univ.name}</h1>
        <img src={this.props.univ.image} class="cover-image" />
        <p></p>
        <h4>Acceptance Rate: {this.props.univ.acceptanceRate}</h4>
        <h4>Most Popular Major: {this.props.univ.popMajor}</h4>
        <h4>Public or Private: {this.props.univ.type}</h4>
        <h4>Tuition: {this.props.univ.tuition}</h4>
        <h4>Rural or Urban: {this.props.univ.setting}</h4>
        <h4>Sports Division: {this.props.univ.sportsDivision}</h4>
        <h4>Post Graduation Salary: {this.props.univ.gradSalary}</h4>
        <h4>Graduation Rate: {this.props.univ.gradRate}</h4>
        <h4>Retention Rate: {this.props.univ.retentionRate}</h4>
        <h4>Student Faculty Ratio: {this.props.univ.ratio}</h4>
        <h4>Religious Affiliation: {this.props.univ.religion}</h4>
        <h4>Demographics: {this.props.univ.demographics}</h4>
        <p></p>
        <Footer />
      </div>
    );
  }
}

export default UniversityData;
